import "./App.css";
import ReactPlayer from "react-player";

function App() {

  const etUses = [
    "Product", 
    "Customer Service", 
    "Systems", 
    "Time Management", 
    "Team Management", 
    "Marketing",
    "Finances",
    "Leadership",
    "Forecasting",
    "Visions"
  ]

  let currentEt = ""

  let currentTimeout = 0

  for(let i = 0; i < 100; i++) {
    let lastDigitNum = 0
    setTimeout(() => {
      if (i > 9) {
        let numString = i.toString()
        let lastDigitString = numString[-1]
        lastDigitNum = parseInt(lastDigitString)
      } else {
        lastDigitNum = i
      }
      currentEt = etUses[lastDigitNum]
      console.log(currentEt, lastDigitNum)
    }, currentTimeout)
    currentTimeout = currentTimeout + 3000
    console.log(currentTimeout)
  }

  return (
    <div id="App">
      <div id="TopSection">
        <h1 id="CompanyName">Company</h1>
        <h2 id="CompanyMatra">E x T = <span id="EtUse">{currentET}</span></h2>
     </div>
     <div id="MiddleSection">
       <div id="VideoContainer">
        <ReactPlayer 
          url="https://vimeo.com/514419233"
          controls="true"
          playsinline="true"
        />
      </div>
     </div>
     <div id="BottomSection">
        <h3 id="CompanyType">Company LLC</h3>
        <h3 id="CompanyEmail">hi@company.com</h3>
     </div>
    </div>
  );
}

export default App;
